// src/Benchmark.jsx
import React, { useState } from "react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";

export default function Benchmark() {
  const [chartData, setChartData] = useState([]);

  const handleRunBenchmark = () => {
    // Simulate benchmark data
    const data = [
      { name: "Test 1", performance: 400 },
      { name: "Test 2", performance: 300 },
      { name: "Test 3", performance: 500 },
      { name: "Test 4", performance: 200 },
      { name: "Test 5", performance: 450 },
    ];
    setChartData(data);
  };

  return (
    <div className="p-8">
      <h2 className="text-2xl font-bold mb-4">System Benchmark</h2>
      <button
        onClick={handleRunBenchmark}
        className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600"
      >
        Run Benchmark
      </button>

      {chartData.length > 0 && (
        <div className="mt-8 bg-white p-4 rounded shadow">
          <h3 className="text-lg font-semibold mb-2">Performance Chart</h3>
          <ResponsiveContainer width="100%" height={300}>
            <LineChart data={chartData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="name" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Line type="monotone" dataKey="performance" stroke="#8884d8" />
            </LineChart>
          </ResponsiveContainer>
        </div>
      )}
    </div>
  );
}
